import React from 'react'
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';
import * as RiIcons from 'react-icons/ri';
import * as BiIcons from 'react-icons/bi';
import * as HiIcons from 'react-icons/hi';

export const SidebarData = [
    {
        title: 'Inventari',
        /*path: '/inventory',*/
        icon: <FaIcons.FaWarehouse />,
        iconClosed: <RiIcons.RiArrowDownSFill />,
        iconOpened: <RiIcons.RiArrowUpSFill />,
        subNav: [
            {
            title: 'Shto Produktin',
            path: '/inventory/addproduct',
            icon: <AiIcons.AiOutlineAppstoreAdd />,
            },
            {
            title: 'Shto Partner',
            path: '/inventory/addproduct',
            icon: <BiIcons.BiBuildingHouse />,
            },
            {
            title: 'Produktet',
            path: '/inventory/products',
            icon: <HiIcons.HiOutlineDocumentSearch />,
            },

        ]
    },
    {
        title: 'Shtije',
        path: '/sales',
        icon: <FaIcons.FaCartPlus />,
    },
    {
        title: 'Raporti',
        path: '/Report',
        icon: <HiIcons.HiOutlineDocumentText />,
    },
    {
        title: 'Informacioni',
        path: '/informacion',
        icon: <HiIcons.HiOutlineInformationCircle />,
    },
    {
        title: 'Llogaria',
        path: '/account',
        icon: <RiIcons.RiAccountCircleFill />,
    },
    {
        title: 'Përditësimet',
        path: '/settings',
        icon: <AiIcons.AiFillSetting />,
    },
]
